import React, { useState, useEffect } from "react";
import {
  Form,
  FormGroup,
  Label,
  Input,
  Button,
  Container,
  Alert,
  Row,
  Col,
} from "reactstrap";
import { useNavigate } from "react-router-dom";
import img from '../Components/img3.JPG';
import { useLanguage } from '../Store/LanguageContext';
import logo from '../Components/logo.j';

const Feed = () => {
  const navigate = useNavigate();
  const [adminMenuOpen, setAdminMenuOpen] = React.useState(false);
  const [adminUnlocked, setAdminUnlocked] = React.useState(false);
  const [showAdminLogin, setShowAdminLogin] = React.useState(false);
  const [adminPassword, setAdminPassword] = React.useState("");
  const [adminError, setAdminError] = React.useState("");
  const ADMIN_PASSWORD = "admin123";
  const [formData, setFormData] = useState({
    name: "",
    event: "",
    rating: 0,
    comments: "",
  });

  const [submitted, setSubmitted] = useState(false);
  const { lang, setLang } = useLanguage();
  const [events, setEvents] = useState([]);
  const [fieldErrors, setFieldErrors] = useState({ name: false, event: false, rating: false, comments: false });
  const [submitError, setSubmitError] = useState("");

  useEffect(() => {
    const fetchEvents = async () => {
      try {
        const res = await fetch('http://localhost:3001/events');
        if (!res.ok) throw new Error('Failed to fetch events');
        const data = await res.json();
        setEvents(data);
      } catch (err) {
        setEvents([
          { en: "Share your opinion, because your opinion matters! ⭐", ar: "⭐ شاركنا رأيك، لأن رأيك يفرق " },
        ]);
      }
    };
    fetchEvents();
  }, []);

  const t = {
    en: {
      formTitle: 'Share your opinion, because your opinion matters! ⭐',
      yourName: 'Your Name',
      namePlaceholder: 'Enter your full name',
      eventName: 'Event Name',
      selectEvent: '-- Select an Event --',
      rating: 'Rating (1 to 5)',
      comments: 'Additional Comments',
      commentsPlaceholder: 'Share your thoughts...',
      submit: 'Submit',
      chooseLang: 'عربي',
    },
    ar: {
      formTitle: '⭐شاركنا رأيك، لأن رأيك يفرق ',
      yourName: 'اسمك',
      namePlaceholder: 'أدخل اسمك الكامل',
      eventName: 'اسم الفعالية',
      selectEvent: '-- اختر فعالية --',
      rating: 'التقييم (1 إلى 5)',
      comments: 'تعليقات إضافية',
      commentsPlaceholder: 'شاركنا رأيك...',
      submit: 'تسليم ',
      chooseLang: 'English',
    }
  };

  const toggleLang = () => setLang(lang === 'en' ? 'ar' : 'en');
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };
  const handleStarClick = (star) => setFormData((prev) => ({ ...prev, rating: star }));

  const handleSubmit = async (e) => {
    e.preventDefault();
    const errors = {
      name: !formData.name.trim(),
      event: !formData.event.trim(),
      rating: !formData.rating,
      comments: !formData.comments.trim(),
    };
    setFieldErrors(errors);
    if (Object.values(errors).some(Boolean)) return;
    try {
      const res = await fetch('http://localhost:3001/feedback', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData)
      });
      if (!res.ok) {
        const data = await res.json();
        setSubmitError(data.msg || (lang === 'ar' ? 'حدث خطأ أثناء الإرسال' : 'Submission failed'));
        return;
      }
      setSubmitted(true);
    } catch (err) {
      setSubmitError(lang === 'ar' ? 'تعذر الاتصال بالخادم' : 'Could not connect to server');
    }
  };

  useEffect(() => {
    if (submitted) {
      const eventParam = encodeURIComponent(formData.event);
      navigate(`/admin/feedback?event=${eventParam}`);
    }
  }, [submitted, navigate]);

  return (
    <Container style={{
      backgroundImage: `url(${img})`,
      backgroundSize: 'cover',
      backgroundPosition: 'center',
      backgroundAttachment: 'fixed',
      minHeight: '90vh',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      fontFamily: 'Tajawal, Cairo, Roboto, Arial, sans-serif',
      color: '#232336'
    }}>
      <Row className="justify-content-center" style={{ position: 'relative', zIndex: 1 }}>
        <Col md={8} lg={6}>
          {/* شعار المؤسسة */}
          <div style={{
            display: 'flex',
            justifyContent: lang === 'ar' ? 'flex-end' : 'flex-start',
            alignItems: 'center',
            marginBottom: '1.2rem',
            marginTop: '-1rem'
          }}>
            <img
              src={logo}
              alt="Logo"
              style={{
                width: '80px',
                height: '80px',
                objectFit: 'contain',
                borderRadius: '50%',
                boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
                background: '#fff',
                padding: '8px'
              }}
            />
          </div>

          {/* هنا يكمل باقي النموذج كما هو */}

        </Col>
      </Row>
    </Container>
  );
};

export default Feed;
